import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './LoanForm.css';

const LoanForm = () => {
  const [formData, setFormData] = useState({
    Full_Name: '',
    Address: '',
    PAN_Number: '',
    Company_Name: '',
    Current_Salary: '',
    Previous_Salary: '',
    Owns_House: '',
    Rent_Amount: '',
    Grocery_Expense: '',
    Current_EMIs: '',
    Date_Previous_Hike: '',
    Date_Next_Hike: '',
    Bank_Name: '',
    Bank_Name_Other: '',
    Credit_Score: '',
    Number_of_Credit_Cards: '',
    Total_Credit_Limit: '',
    Number_of_Loans: '',
    Employment_Duration: '',
    Job_Title: '',
    Job_Title_Other: '',
    Bonuses_Allowances: '',
    Savings: '',
    Investments: '',
    Monthly_Expenses: '',
    Age: '',
    Education_Level: '',
    Marital_Status: '',
    Dependents: '',
    Loan_Purpose: '',
    Mall_Visits_Per_Month: '',
    Mall_Spend_Average: '',
    bankOptions: [],
    jobTitleOptions: []
  });

  useEffect(() => {
    // Fetch real-time bank data from an API
    const fetchBankData = async () => {
      try {
        const response = await axios.get('https://api.example.com/indian-banks'); // Replace with actual API
        setFormData(prevFormData => ({
          ...prevFormData,
          bankOptions: response.data.banks
        }));
      } catch (error) {
        console.error('Error fetching bank data:', error);
      }
    };

    // Fetch real-time job titles from an API
    const fetchJobTitleData = async () => {
      try {
        const response = await axios.get('https://api.example.com/indian-job-titles'); // Replace with actual API
        setFormData(prevFormData => ({
          ...prevFormData,
          jobTitleOptions: response.data.jobTitles
        }));
      } catch (error) {
        console.error('Error fetching job title data:', error);
      }
    };

    fetchBankData();
    fetchJobTitleData();
  }, []);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prevFormData => {
      if (name === 'Owns_House' && value === 'Yes') {
        return {
          ...prevFormData,
          [name]: value,
          Rent_Amount: '' // Clear Rent_Amount when Owns_House is "Yes"
        };
      }
      return {
        ...prevFormData,
        [name]: value
      };
    });
  };

  const handleBankChange = (e) => {
    const { name, value } = e.target;
    setFormData(prevFormData => {
      if (name === 'Bank_Name' && value === 'Other') {
        return {
          ...prevFormData,
          [name]: value,
          Bank_Name_Other: ''
        };
      }
      return {
        ...prevFormData,
        [name]: value
      };
    });
  };

  const handleJobTitleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prevFormData => {
      if (name === 'Job_Title' && value === 'Other') {
        return {
          ...prevFormData,
          [name]: value,
          Job_Title_Other: ''
        };
      }
      return {
        ...prevFormData,
        [name]: value
      };
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://127.0.0.1:5000/predict', formData);
      console.log('Prediction Results:', response.data);
      // Handle the response as needed
    } catch (error) {
      console.error('Error making prediction:', error.response ? error.response.data : error.message);
    }
  };

  return (
    <form onSubmit={handleSubmit} className="form-all">
      <div className="form-section">
        <h2>Personal Information</h2>
        <div className="form-row">
          <div className="form-line">
            <label className="form-label">
              Full Name
              <input type="text" name="Full_Name" value={formData.Full_Name} onChange={handleChange} className="form-textbox" />
            </label>
          </div>
          <div className="form-line">
            <label className="form-label">
              Address
              <input type="text" name="Address" value={formData.Address} onChange={handleChange} className="form-textbox" />
            </label>
          </div>
        </div>
        <div className="form-row">
          <div className="form-line">
            <label className="form-label">
              PAN Number
              <input type="text" name="PAN_Number" value={formData.PAN_Number} onChange={handleChange} className="form-textbox" />
            </label>
          </div>
          <div className="form-line">
            <label className="form-label">
              Age
              <input type="number" name="Age" value={formData.Age} onChange={handleChange} min="0" className="form-textbox" />
            </label>
          </div>
        </div>
        <div className="form-row">
          <div className="form-line">
            <label className="form-label">
              Education Level
              <select name="Education_Level" value={formData.Education_Level} onChange={handleChange} className="form-dropdown">
                <option value="">Select</option>
                <option value="Graduate">Graduate</option>
                <option value="PostGraduate">PostGraduate</option>
                <option value="PhD">PhD</option>
              </select>
            </label>
          </div>
          <div className="form-line">
            <label className="form-label">
              Marital Status
              <select name="Marital_Status" value={formData.Marital_Status} onChange={handleChange} className="form-dropdown">
                <option value="">Select</option>
                <option value="Single">Single</option>
                <option value="Married">Married</option>
                <option value="Widowed">Widowed</option>
                <option value="Divorced">Divorced</option>
              </select>
            </label>
          </div>
        </div>
        <div className="form-row">
          <div className="form-line">
            <label className="form-label">
              Dependents
              <input type="number" name="Dependents" value={formData.Dependents} onChange={handleChange} min="0" className="form-textbox" />
            </label>
          </div>
          <div className="form-line">
            <label className="form-label">
              Loan Purpose
              <select name="Loan_Purpose" value={formData.Loan_Purpose} onChange={handleChange} className="form-dropdown">
                <option value="">Select</option>
                <option value="Home Improvement">Home Improvement</option>
                <option value="Education">Education</option>
                <option value="Medical">Medical</option>
                <option value="Other">Other</option>
              </select>
            </label>
          </div>
        </div>
      </div>

      <div className="form-section">
        <h2>Financial Information</h2>
        <div className="form-row">
          <div className="form-line">
            <label className="form-label">
              Company Name
              <input type="text" name="Company_Name" value={formData.Company_Name} onChange={handleChange} className="form-textbox" />
            </label>
          </div>
          <div className="form-line">
            <label className="form-label">
              Current Salary
              <input type="number" name="Current_Salary" value={formData.Current_Salary} onChange={handleChange} min="0" className="form-textbox" />
            </label>
          </div>
        </div>
        <div className="form-row">
          <div className="form-line">
            <label className="form-label">
              Previous Salary
              <input type="number" name="Previous_Salary" value={formData.Previous_Salary} onChange={handleChange} min="0" className="form-textbox" />
            </label>
          </div>
          <div className="form-line">
            <label className="form-label">
              Employment Duration
              <input type="text" name="Employment_Duration" value={formData.Employment_Duration} onChange={handleChange} className="form-textbox" />
            </label>
          </div>
        </div>
        <div className="form-row">
          <div className="form-line">
            <label className="form-label">
              Owns House
              <select name="Owns_House" value={formData.Owns_House} onChange={handleChange} className="form-dropdown">
                <option value="">Select</option>
                <option value="Yes">Yes</option>
                <option value="No">No</option>
              </select>
            </label>
          </div>
          {formData.Owns_House === 'No' && (
            <div className="form-line">
              <label className="form-label">
                Rent Amount
                <input type="number" name="Rent_Amount" value={formData.Rent_Amount} onChange={handleChange} min="0" className="form-textbox" />
              </label>
            </div>
          )}
        </div>
        <div className="form-row">
          <div className="form-line">
            <label className="form-label">
              Grocery Expense
              <input type="number" name="Grocery_Expense" value={formData.Grocery_Expense} onChange={handleChange} min="0" className="form-textbox" />
            </label>
          </div>
          <div className="form-line">
            <label className="form-label">
              Current EMIs
              <input type="number" name="Current_EMIs" value={formData.Current_EMIs} onChange={handleChange} min="0" className="form-textbox" />
            </label>
          </div>
        </div>
        <div className="form-row">
          <div className="form-line">
            <label className="form-label">
              Date of Previous Salary Hike
              <input type="date" name="Date_Previous_Hike" value={formData.Date_Previous_Hike} onChange={handleChange} className="form-textbox" />
            </label>
          </div>
          <div className="form-line">
            <label className="form-label">
              Date of Next Salary Hike
              <input type="date" name="Date_Next_Hike" value={formData.Date_Next_Hike} onChange={handleChange} className="form-textbox" />
            </label>
          </div>
        </div>
      </div>

      <div className="form-section">
        <h2>Bank Information</h2>
        <div className="form-line">
          <label className="form-label">
            Bank Name
            <select name="Bank_Name" value={formData.Bank_Name} onChange={handleBankChange} className="form-dropdown">
              <option value="">Select</option>
              {formData.bankOptions.map(bank => (
                <option key={bank} value={bank}>{bank}</option>
              ))}
              <option value="Other">Other</option>
            </select>
          </label>
          {formData.Bank_Name === 'Other' && (
            <input type="text" name="Bank_Name_Other" value={formData.Bank_Name_Other} onChange={handleChange} placeholder="Enter bank name" className="form-textbox" />
          )}
        </div>
      </div>

      <div className="form-section">
        <h2>Job Information</h2>
        <div className="form-line">
          <label className="form-label">
            Job Title
            <select name="Job_Title" value={formData.Job_Title} onChange={handleJobTitleChange} className="form-dropdown">
              <option value="">Select</option>
              {formData.jobTitleOptions.map(title => (
                <option key={title} value={title}>{title}</option>
              ))}
              <option value="Other">Other</option>
            </select>
          </label>
          {formData.Job_Title === 'Other' && (
            <input type="text" name="Job_Title_Other" value={formData.Job_Title_Other} onChange={handleChange} placeholder="Enter job title" className="form-textbox" />
          )}
        </div>
      </div>

      <div className="form-section">
        <h2>Additional Information</h2>
        <div className="form-row">
          <div className="form-line">
            <label className="form-label">
              Bonuses/Allowances
              <input type="number" name="Bonuses_Allowances" value={formData.Bonuses_Allowances} onChange={handleChange} min="0" className="form-textbox" />
            </label>
          </div>
          <div className="form-line">
            <label className="form-label">
              Savings
              <input type="number" name="Savings" value={formData.Savings} onChange={handleChange} min="0" className="form-textbox" />
            </label>
          </div>
        </div>
        <div className="form-row">
          <div className="form-line">
            <label className="form-label">
              Investments
              <input type="number" name="Investments" value={formData.Investments} onChange={handleChange} min="0" className="form-textbox" />
            </label>
          </div>
          <div className="form-line">
            <label className="form-label">
              Monthly Expenses
              <input type="number" name="Monthly_Expenses" value={formData.Monthly_Expenses} onChange={handleChange} min="0" className="form-textbox" />
            </label>
          </div>
        </div>
      </div>

      <button type="submit" className="form-submit-button">Submit</button>
    </form>
  );
};

export default LoanForm;
